import React from "react";
import axios from "axios";

import "./App.css";

class App extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      products: []
    };
  }

  componentDidMount() {
    axios
      .get(`http://127.0.0.1:8001/api/products`, {
        mode: "no-cors",
        headers: {
          "Access-Control-Allow-Origin": "*",
          "Content-Type": "application/json"
        }
      })

      .then(res => {
        const data = res.data;
        console.log(data);
        this.setState({ products: data[0] });
      });
  }

  render() {
    const { products } = this.state;
    return (
      <div>
        {products.map(turtle => (
          <div>
            <h1>
              {turtle.name} ({turtle.nickName})
            </h1>
            <p>Weapon of choice: {turtle.weapon}</p>
            <img src={turtle.imgUrl} alt={`${turtle.name}`} width="200" />
            <hr />
          </div>
        ))}
      </div>
    );
  }
}

export default App;
